            textToShow = allWords[paintedWordIndex % allWords.length];

            if (sketchGuiState.text.reverseOrder) {
              paintedWordIndex--;
              if (paintedWordIndex < 0) {
                paintedWordIndex = allWords.length - 1;
              }
            } else {
